import './App.css';
import React from 'react'
import {BrowserRouter, Route, Routes, Navigate, Switch} from 'react-router-dom'

function App() {
  return (
    <Switch>
      <Route exact path="/dogs" >
        <DogList /> {/*what props will this need? */}
      </Route>
      <Route path="/dogs/:name" >
        <DogDetails />   {/*what props will this need? */}
      </Route>
      <Redirect to="/dogs" />
    </Switch>
  );
}

export default App;
